import React from 'react';

const Head = ({title, }) => {
  React.useEffect(() => {
    document.title = `KL | ${props.title}`;
    document
      .querySelector('meta[name="description"]')
      .setAttribute('content', props.description);
  }, [props]);

  return <></>;
};

export default Head;
